				["init"] = {
					["custom"] = "aura_env.cd = {\n    [47528]=15,--Mind Freeze\n    [91802]=30, --Shambling Rush\n    [96231]=15,--Rebuke\n    [6552]=15,--Pummel\n    [106839]=15,--Skull Bash\n    [119910]=24,--Spell lock sac\n    [19647]=24, --spell lock\n    [119911]=24, --Optical Blast\n    [115781]=24,--Optical blast\n    [132409]=24, --sac spell lock\n    [171138]=24, --shadow lock\n    [171139]=24, -- ^^\n    [171140]=24, -- ^^\n    [57994]=12, --Wind shear\n    [147362]=24, --Counter Shot\n    [2139]=24, -- Counterspell\n    [1766]=15,--Kick\n    [116705]=15, --Spear hand strike\n    [97547]=60, --Solar Beam\n    [78675]=60,--extra solar\n    --[31935]=15, --Avenger's Shield\n    [183752]=15, --Consume Magic (DH)\n    [15487]=45, -- Priest Silence\n    [187707]=15, --Muzzle - Thanks sluth!\n    \n}\naura_env.Pets={\n    [19647]=24, --spell lock\n    [119911]=24, --Optical Blast\n    [115781]=24,--Optical blast\n    [171138]=24, --shadow lock\n    [171139]=24, -- ^^\n    [171140]=24, -- ^^\n}\n\n\n\n\naura_env.findUnit = function(unitGUID)\n    --We should cache units instead of checking all possible units\n    if unitGUID==UnitGUID(\"player\") then return \"player\" end\n    if unitGUID==UnitGUID(\"target\") then return \"target\" end\n    if unitGUID==UnitGUID(\"focus\") then return \"focus\" end\n    for i=1,40 do\n        local unitName=\"raid\" .. i\n        if unitGUID==UnitGUID(unitName) then return unitName end\n    end\n    for i=1,40 do\n        local unitName=\"nameplate\" .. i\n        if unitGUID==UnitGUID(unitName) then return unitName end\n    end\n    for i=1,40 do\n        local unitName=\"raid\" .. i .. \"target\"\n        if unitGUID==UnitGUID(unitName) then return unitName end\n    end\n    \n    \n    \nend",
