						["custom"] = "function(allstates, event,...)\n    if select(2, ...) == \"SPELL_CAST_START\" then\n        local castSpellId = select(12, ...)\n        if castSpellId == aura_env.castSpellId then\n            local sourceGUID = \"Totem2\"\n            local _,  _, icon = GetSpellInfo(castSpellId)\n            local duration = 8\n            local expiration = GetTime()+8\n            allstates[sourceGUID] = {\n                show = true,\n                changed = true,\n                progressType = \"timed\",\n                duration = duration,\n                expirationTime = expiration,\n                autoHide = true,\n                icon = icon,\n                name = \"Stopcasting\",\n            }\n        end \n    end\n    \n    \n    if event == \"UNIT_SPELLCAST_SUCCEEDED\" or event == \"UNIT_SPELLCAST_INTERRUPTED\" or event == \"UNIT_SPELLCAST_FAILED\" or event == \"UNIT_SPELLCAST_STOP\" or event == \"UNIT_SPELLCAST_FAILED_QUIET\" then\n        local caster,lineId,castSpellId = ...\n        if castSpellId == aura_env.castSpellId then\n            if allstates[\"Totem2\"] then\n                allstates[\"Totem2\"].show = false\n                allstates[\"Totem2\"].changed = true\n            end   \n        end     \n    end\n    return true\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
